import { Base } from './Base.js';
import { ChannelTypes, UUID } from '../util/mod.js';
export class Channel extends Base {
    constructor() {
        super(...arguments);
        Object.defineProperty(this, "type", {
            enumerable: true,
            configurable: true,
            writable: true,
            value: 'UNKNOWN'
        });
    }
    get createdTimestamp() {
        return this.createdAt.getTime();
    }
    get createdAt() {
        return UUID.timestampOf(this.id);
    }
    delete() {
        return this.client.channels.delete(this);
    }
    isText() {
        return 'messages' in this;
    }
    isVoice() {
        return this.type === ChannelTypes.VOICE;
    }
    isGroup() {
        return this.type === ChannelTypes.GROUP;
    }
    inServer() {
        return 'serverId' in this;
    }
    toString() {
        return `<#${this.id}>`;
    }
    fetch(force = true) {
        return this.client.channels.fetch(this, { force });
    }
}
